Iced is a GUI libray for Rust which uses the MVU (Model-View-Update) architecture—also known as TEA (The Elm Architecture) . The MVU architecture consists of a single event loop with exclusive ownership of the application model, a view function for creating views from the model, and an update function for updating the model. The model creates the view, the view is displayed to the user, the user sends inputs to the view, and any messages emitted by widgets in view are used to update the model. A simplified abstract code example is provided below. use magic::{display, interact}; // Initialize the state
let mut app = AppModel::init(); // Be interactive. All the time!
loop { // Run our view logic to obtain our interface let view = view(&app); // Display the interface to the user display(&view); // Process the user interactions and obtain our messages let messages = interact(&view); // Update our state by processing each message for message in messages { update(&mut app); }
}

